  function prepareJsonData() {
    var newJson = [];
    for (var i = 0; i < testjson.length; i++) {
      subject = testjson[i].subject;

      seats_left = testjson[i].seats_left;
      var str = testjson[i].seats_left;
      var startInd = 0;
      var endInd = str.indexOf("out") - 1;

      seatsLeft = Number(str.substring(startInd, endInd));

      startInd = str.lastIndexOf(" ") + 1;
      endInd = str.length;
      seatsTotal = Number(str.substring(startInd, endInd));

      oneItem = {
        subject: subject,
        seatsLeft: seatsLeft,
        seatsTotal: seatsTotal,
      };
      newJson.push(oneItem);
    }
    var allSubjectArr = []; // all subject names array
    var subjectDict = {}; // dictionary
    for (i = 0; i < newJson.length; i++) {
      oneSubject = newJson[i].subject; // just the subject name, like MIS
      if (oneSubject in subjectDict) {
        subjectDict[oneSubject].push(newJson[i]);
      } else {
        subjectDict[oneSubject] = [];
        allSubjectArr.push(oneSubject);
      }
    }
    var subjectWithSeatsJson = {}; // final result
    for (i = 0; i < allSubjectArr.length; i++) {
      oneSubject = allSubjectArr[i]; // the subject name
      allOneSubjectClasses = subjectDict[oneSubject];
      var totalSeats = 0;
      var totalSeatsLeft = 0;
      for (j = 0; j < allOneSubjectClasses.length; j++) {
        totalSeats = totalSeats + allOneSubjectClasses[j].seatsTotal;
        totalSeatsLeft = totalSeatsLeft + allOneSubjectClasses[j].seatsLeft;
      }

      // one subject in the final result
      oneSubjectSum = {
        subject: oneSubject,
        seatsLeft: totalSeatsLeft,
        seatsTotal: totalSeats,
      };
      subjectWithSeatsJson[oneSubject] = oneSubjectSum;
    }
    return subjectWithSeatsJson;
  }


